import React from 'react'
class Displayin4 extends React.Component {
    render(){
        const {lannisters} = this.props;
        console.log(lannisters);
        return(
            <div>
                {lannisters.map((character) => {
                    return(
                        <div>
                            <div>My name {this.character.lannisters.name} I am I live in </div> 
                        </div>
                    )
                })}
            </div>
        )   
    }
}   
export default Displayin4;
